import {
    Alert,
    AlertIcon,
    AlertTitle,
    AlertDescription,
} from "@chakra-ui/react";


function Error404(){
    return (
    <div>
        <Alert status="error">
            <AlertIcon/>
            <AlertTitle mr={2}>ERROR 404!</AlertTitle>
            <AlertDescription>
                This page was not found...
            </AlertDescription>
        </Alert>
    </div>
    );
}

export default Error404;
